import React, { Component } from 'react'
import Layout from '../components/layout'
import Link from 'next/link'
import Aboutapp from './about_app/About_index'


class About extends Component {
    render() {
        return(
            <Layout>
                <div id="root" >
                    <Aboutapp/>
                    </div>
            </Layout>
        )
    }
}



export default About
